unt Type'=>'アカウントの種類','Account username'=>'アカウントのユーザー名','Accounts &amp; Privacy'=>'アカウントとプライバシー','Acre'=>'エーカー州','Action'=>'操作','Action [%1$s] has an invalid schedule: %2$s'=>'アクション [%1$s] に無効な予約があります。%2$s','Action [%1$s] has invalid arguments. It cannot be JSON decoded to an array. $args = %2$s'=>'アクション [%1$s] に無効な引数があります。JSON を配列に復号化したものは使えません。 $args = %2$s','action canceled'=>'アクションがキャンセルされました','action complete'=>'アクションが完了しました','action complete via %s'=>'%s 経由でアクションが完了しました','action created'=>'アクションが作成されました','Action event'=>'イベントの処理','action failed via %1$s: %2$s'=>'%1$s 経由でアクションが失敗しました。%2$s','Action failed. Please refresh the page and retry.'=>'操作に失敗しました。ページを再読み込みし、もう一度お試しください。','action failed: %s'=>'アクションが失敗しました:%s','Action Group'=>'アクショングループ','action ignored'=>'無視されたアクション','action ignored via %s'=>'%s 経由でアクションが無視されました','action marked as failed after %s seconds. Unknown error occurred. Check server, PHP and database error logs to diagnose cause.'=>'%s秒後に、操作が失敗としてマークされました。 不明なエラーが発生しました。 サーバー、PHP、データベースのエラーログを確認して、原因を特定してください。','action reset'=>'アクションがリセットされました','Action Scheduler'=>'アクションスケジューラー','Action Scheduler has migrated data to custom tables; however, orphaned log entries exist in the WordPress Comments table. %1$s <a href="%2$s">Learn more &raquo;</a>'=>'アクションスケジューラーによって、データがカスタムテーブルに移行されましたが、WordPress コメントテーブルに孤立したログエントリーがあります。%1$s <a href="%2$s">さらに詳しく »</a>','Action Scheduler is a scalable, traceable job queue for background processing large sets of actions. Action Scheduler works by triggering an action hook to run at some time in the future. Scheduled actions can also be scheduled to run on a recurring schedule.'=>'アクションスケジューラーは、大規模なアクションをバックグラウンド処理する際の拡張、追跡可能なジョブキューです。アクションスケジューラーは、将来のいずれかの時点でアクションフックをトリガーして実行することで動作します。予約済みアクションは、定期的なスケジュールで実行するよう予約することもできます。','Action Scheduler migration in progress. The list of scheduled actions may be incomplete.'=>'アクションスケジューラーの移行が進行中です。予約済みアクションのリストが不完全な可能性があります。','Action Scheduler package'=>'アクションスケジューラーパッケージ',