 a coupon, this coupon will enable free shipping.'=>'true と送料無料の方法でクーポンが必要な場合は、このクーポンで送料が無料になります。','If true, calculates rating counts for products in the collection.'=>'true の場合、コレクションで商品の評価カウントを計算します。','If true, calculates stock counts for products in the collection.'=>'true の場合、コレクションの商品の在庫数を計算します。','If true, calculates the minimum and maximum product prices for the collection.'=>'true の場合、コレクションの最低と最高商品価格を計算します。','If true, empty terms will not be returned.'=>'true の場合、空の語句は返されません。','If true, only one item of this product is allowed for purchase in a single order.'=>'true の場合、1回のご注文ではこの商品項目の購入は1個だけ許容されます。','If true, the coupon can only be used individually. Other applied coupons will be removed from the cart.'=>'true の場合、クーポンは個別にしか使用できません。他の適用クーポンはお買い物かごから取り除かれます。','If true, the defined value is the final effective value; if false, the effective value is the base value from the parent product plus the defined value.'=>'true の場合、定義された値が最終的な有効値になります。false の場合、有効値は親商品の基本値に定義された値を加えた値になります。','If true, the note will be shown to customers and they will be notified. If false, the note will be for admin reference only.'=>'true の場合、顧客に通知が表示され、通知されます。false の場合、注釈は管理者参照のみになります。','If true, this coupon will not be applied to items that have sale prices.'=>'true の場合、このクーポンは販売価格の商品には適用されません。','If true, this note will be attributed to the current user. If false, the note will be attributed to the system.'=>'True の場合は、現在のユーザーがこのメモの執筆者になります。False の場合は、システムがこのメモの執筆者になります。','If unchecked, customers will need to set a username during account creation.'=>'チェックしなかった場合、お客様はアカウント作成中にユーザー名を設定する必要があります。','If you are modifying WooCommerce on a parent theme that you did not build personally we recommend using a child theme. See: <a href="%s" target="_blank">How to create a child theme</a>'=>'WooCommerce に準拠しているテーマや親テーマを修正するのではなく、子テーマを作ることをおすすめします。<a href="%s" target="_blank">子テーマの作り方はこちら</a>をご覧ください。','If you are using X-Accel-Redirect download method along with NGINX server, make sure that you have applied settings as described in <a href=\'%s\'>Digital/Downloadable Product Handling</a> guide.'=>'NGINXサーバーとともにX-Accel-Redirectのダウンロード方法を使用している場合は、<a href=\'%s\'>デジタル/ダウンロード可能な商品の取り扱い</a>ガイドの説明に従って設定を適用したことを確認してください。','If you copied over a template file to change something, then you will need to copy the new version of the template and apply your changes again.'=>'テンプレートファイルをコピーして一部を変更した場合は、テンプレートの新しいバージョンをコピーし、変更を再度適用する必要があります。','If you create an account, we will store your name, address, email and phone number, which will be used to populate the checkout for future orders.'=>'お客様がアカウントを作成する場合は、今後の注文の際に購入画面に取り込むための名前、メールアドレス、および電話番号を保管します。','If you define a "Terms" page the customer will be asked if they accept them when checking out.'=>'「利用規約」ページを定義した場合、購入手続き時にお客様に承認するかどうかを尋ねることができます。','If you didn\'t make this request, just ignore this email. If you\'d like to proceed:'=>'このリクエストに心当たりがない場合は、このメールを無視してください。次に進むには:','If you don\'t have an application password (not your account password), generate a password from %s'=>'アプリケーションのパスワード (アカウントのパスワードではありません) がない場合は、%s からパスワードを生成してください','If you find a bug within WooCommerce core you can create a ticket via <a href="%1$s">GitHub issues</a>. Ensure you read the <a href="%2$s">contribution guide</a> prior to submitting your report. To help us solve your issue, please be as descriptive as possible and include your <a href="%3$s">system status report</a>.'=>'WooCommerce コア内にバグを見つけた場合は、<a href="%1$s">GitHub イシュー</a>経由でチケットを作成できます。 レポートの送信前に、必ず<a href="%2$s">参加ガイド</a>をお読みください。 問題解決に役立てるため、できるだけ詳しく説明し、<a href="%3$s">システムステータスレポート</a>を含めるようにしてください。','If you have a coupon code, please apply it below.'=>'クーポンコードをお持ちの場合は、以下に適用してください。','If you have shopped with us before, please enter your details below. If you are a new customer, please proceed to the Billing section.'=>'以前に当店で買い物をしたことがある方は以下に詳細を入力してください。新規のお客様は「請求と配送」セクションに進んでください。','If you like %1$s please leave us a %2$s rating. A huge thanks in advance!'=>'もし %1$s を気に入っていただけたなら、%2$s評価をつけていただけると嬉しいです。','If you like, you may enter custom structures for your product URLs here. For example, using <code>shop</code> would make your product links like <code>%sshop/sample-product/</code>. This setting affects product URLs only, not things such as product categories.'=>'必要に応じて、ここに商品 URL のカスタム構造を入力することができます。たとえば、  <code>shop</code>  を使用すると、商品リンクが <code>%sshop/sample-product/</code> のようになります。この設定は商品の URL にのみ影響し、商品カテゴリなどには影響しません。','If you need to access the setup wizard again, please click on the button below.'=>'また設定ウィザードにアクセスする必要がある場合は、下のボタンをクリックしてください。','If you need to enable or disable the extended task lists, please click on the button below.'=>'拡張タスクリストを有効または無効にする必要がある場合は、下のボタンをクリックしてください。','If you need to enable or disable the task lists, please click on the button below.'=>'タスクリストを有効または無効にする必要がある場合は、下のボタンをクリックしてください。','If you remove this attribute, customers will no longer be able to purchase some variations of this product.'=>'この属性を削除すると、顧客はこの商品のバリエーションを購入できなくなります。','If you\'d like to continue with your purchase, please return to %s and try a different method of payment.'=>'購入を続行する場合は、%s に戻って別の支払い方法を試してください。','If you\'d like to offer <span class="help_tip" data-tip="%1$s">live rates</span> from a specific carrier (e.g. UPS) you can find a variety of extensions available for WooCommerce <a href="%2$s" target="_blank">here</a>.'=>'特定の配送業者 (UPS など) からの<span class="help_tip" data-tip="%1$s">リアルタイムの料金</span>を提示するには、<a href="%2$s" target="_blank">ここ</a>に、WooCommerce に利用できるさまざまな拡張機能があります。','If you\'ve just placed an order, give your email a quick check for the confirmation.'=>'たった今注文をした場合は、メールボックスでメールをご確認ください。','If your main PayPal email differs from the PayPal email entered above, input your main receiver email for your PayPal account here. This is used to validate IPN requests.'=>'メインの PayPal メールアドレスが上記で入力したアドレスと違う場合、ここに支払いを受け取る  PayPal アカウントのアドレスを入力してください。これは IPN リクエストの検証に使われます。','If your store is based in the EU, we recommend using the 