ed, as GMT.'=>'注文メモの作成日 (GMT)。','The date the order note was created, in the site\'s timezone.'=>'注文メモの作成日 (サイトのタイムゾーン)。','The date the order refund was created, as GMT.'=>'注文払い戻しの作成日 (GMT)。','The date the order refund was created, in the site\'s timezone.'=>'注文払い戻しの作成日 (GMT)。','The date the order was completed, as GMT.'=>'注文の完了日 (GMT)。','The date the order was completed, in the site\'s timezone.'=>'注文の完了日 (サイトのタイムゾーン)。','The date the order was created, as GMT.'=>'注文の作成日 (GMT)。','The date the order was created, in the site\'s timezone.'=>'注文の作成日 (サイトのタイムゾーン)。','The date the order was last modified, as GMT.'=>'注文の最終変更日 (GMT)。','The date the order was last modified, in the site\'s timezone.'=>'注文の最終変更日 (サイトのタイムゾーン)。','The date the order was paid, as GMT.'=>'注文の支払い日 (GMT)。','The date the order was paid, in the site\'s timezone.'=>'注文の支払い日 (サイトのタイムゾーン)。','The date the product was created, as GMT.'=>'商品の作成日 (GMT)。','The date the product was created, in the site\'s timezone.'=>'商品の作成日 (サイトのタイムゾーン)。','The date the product was last modified, as GMT.'=>'商品の最終変更日 (GMT)。','The date the product was last modified, in the site\'s timezone.'=>'商品の最終変更日 (サイトのタイムゾーン)。','The date the report end, as GMT.'=>'レポート終了日 (GMT)。','The date the report end, in the site\'s timezone.'=>'レポート終了日 (サイトのタイムゾーン)。','The date the report start, as GMT.'=>'レポート開始日 (GMT)。','The date the report start, in the site\'s timezone.'=>'レポート開始日 (サイトのタイムゾーン)。','The date the review was created, as GMT.'=>'レビューの作成日 (GMT)。','The date the review was created, in the site\'s timezone in human-readable format.'=>'レビュー作成日 (人間が判読可能な形式でのサイトのタイムゾーン)。','The date the review was created, in the site\'s timezone.'=>'レビュー作成日 (サイトのタイムゾーン)。','The date the variation was created, in the site\'s timezone.'=>'バリエーション作成日 (サイトのタイムゾーン)。','The date the variation was last modified, in the site\'s timezone.'=>'バリエーションの最終更新日 (サイトのタイムゾーン)。','The date the webhook delivery was logged, as GMT.'=>'Webhook 配信の記録日 (GMT)。','The date the webhook delivery was logged, in the site\'s timezone.'=>'Webhook 配信の記録日 (サイトのタイムゾーン)。','The date the webhook was created, as GMT.'=>'Webhook の作成日 (GMT)。','The date the webhook was created, in the site\'s timezone.'=>'Webhook の作成日 (サイトのタイムゾーン)。','The date the webhook was last modified, as GMT.'=>'Webhook の最終更新日 (GMT)。','The date the webhook was last modified, in the site\'s timezone.'=>'Webhook の最終更新日 (サイトのタイムゾーン)。','The date when download access expires, as GMT.'=>'ダウンロードアクセスの有効期限日 (GMT)。','The date when download access expires, in the site\'s timezone.'=>'ダウンロードアクセスの有効期限日 (サイトのタイムゾーン)。','The date you provided is invalid.'=>'提示した日付が無効です。','The date/time the action is/was scheduled to run.'=>'アクション実行の予約日時。','The decimal separator of displayed prices.'=>'表示される価格の小数点記号。','The default timezone for your server.'=>'お使いのサーバーのデフォルトタイムゾーン。','The delivery duration, in seconds.'=>'秒単位での配信期間。','The discount type for the coupon (e.g. percentage or fixed amount)'=>'クーポンの割引のタイプ (割引率または固定金額など)','The downloadable file %1$s cannot be used as it does not have an allowed file type. Allowed types include: %2$s'=>'ダウンロードファイルの %1$s は許可されているファイル形式ではないので使えません。許可されいてるファイル形式は以下です。: %2$s','The downloadable file %s cannot be used as it does not exist on the server, or is not located within an approved directory. Please contact a site administrator for help. %2$sLearn more.%3$s'=>'ダウンロードファイルの%sはサーバーに存在しないか、承認済みディレクトリに存在しないため、使用できません。 サイト管理者にお問い合わせください。 %2$sさらに詳しく。%3$s','The downloadable file %s cannot be used as it has been disabled.'=>'ダウンロード可能なファイル「%s」は無効化されているため使用できません。','The email address for the customer.'=>'顧客のメールアドレス。','The email address provided does not match the email address on this order.'=>'入力されたメールアドレスは、この注文のメールアドレスと一致しません。','The Eway extension for WooCommerce allows you to take credit card payments directly on your store without redirecting your customers to a third party site to make payment.'=>'WooCommerce の Eway 拡張機能を使用すると、サードパーティのサイトで支払いを行うために顧客を転送することなく、ストアでクレジットカードによる支払いを直接行えます。','The eWAY extension for WooCommerce allows you to take credit card payments directly on your store without redirecting your customers to a third party site to make payment.'=>'WooCommerce の eWAY 拡張機能を使用すると、サードパーティのサイトで支払いを行うために顧客を転送することなく、ストアでクレジットカードによる支払いを直接行えます。','The extension %s has been deactivated successfully.'=>'拡張機能 %s を正常に停止しました。','The field %1$s is invalid for the location %2$s.'=>'「%1$s」フィールドはロケーション「%2$s」に対して無効です。','The field %s is invalid.'=>'「%s」フィールドが無効です。','The field %s is required.'=>'「%s」フィールドは必須です。','The file does not exist, please try again.'=>'ファイルが存在しません。もう一度お試しください。','The file is empty or using a different encoding than UTF-8, please try again with a new file.'=>'ファイルが空か、エンコーディングが UTF-8 でありません。別のファイルを再度アップロードしてください。','The following active plugin(s) have not declared compatibility with WooCommerce %s yet and should be updated and examined further before you proceed:'=>'次の有効なプラグインはまだ WooCommerce %s との互換性を宣言しておらず、処理を進める前にさらに更新して調べる必要があります: ','The following addresses will be used on the checkout page by default.'=>'以下の住所を購入手続きページでの初期値として使用します。','The following note has been added to your order:'=>'次のメモをご注文に追加しました:','The following options affect how prices are displayed on the frontend.'=>'次のオプションは、価格がフロントエンドでどのように表示されるかに影響します。','The following plugins will be installed and activated for you:'=>'以下のプラグインが自動的にインストールされて有効化されます。','The following problems were found:'=>'以下の問題が見つかりました:','The following wizard will help you configure your store and get you started quickly.'=>'以下のウィザードがストアの設定をお手伝いし、すぐに販売開始できるようにします。','The font face family name is required.'=>'フォントフェイスファミリーの名前は必須項目です。','The font face font style is required.'=>'フォントフェイスのフォントスタイルは必須項目です。','The font face src is required.'=>'フォントフェイスの src は必須項目です。','The font face weight is required.'=>'フォントフェイスの太さは必須項目です。','The font family name is required.'=>'フォントファミリーの名前は必須項目です。','The font family preview is required.'=>'フォントファミリーのプレビューは必須項目です。','The footer text color. Default %s.'=>'フッターテキストの色です。 %s (デフォルト)','The four 