きに使用されるキー。 <a href="%1$s">MaxMind Geolocation 連携ドキュメント</a>で生成方法を読むことができます。','The largest filesize that can be contained in one post.'=>'一つの投稿に含められる最大ファイルサイズ。','The largest filesize that can be uploaded to your WordPress installation.'=>'WordPress インストールにアップロードできる最大ファイルサイズ。','The layout of the note (e.g. banner, thumbnail, plain).'=>'メモのレイアウト (バナー、サムネイル、プレーンなど)。','The legacy REST API is enabled'=>'レガシー REST API が有効です','The legacy REST API is NOT enabled'=>'レガシー REST API は有効ではありません','The Legacy REST API plugin is not installed on this site.'=>'このサイトには、レガシー REST API プラグインはインストールされていません。','The location that the MaxMind database should be stored. By default, the integration will automatically save the database here.'=>'MaxMind データベースを保存する場所。 デフォルトでは、連携によりデータベースが自動的にここに保存されます。','The logging handler class.'=>'ロギングハンドラーのクラス。','The logical relationship between attributes when filtering across multiple at once.'=>'複数を一度にフィルタリングする場合の属性間の論理的な関係。','The main body background color. Default %s.'=>'本文の背景色。デフォルトは %s。','The main body text color. Default %s.'=>'本文テキストの色。デフォルトは %s。','The main description of the sale with at least 65 characters'=>'セールについての65文字以上の主な説明文','The marketing channel that this campaign type belongs to.'=>'このキャンペーンの種類が属するマーケティングチャネル。','The maximum allowed setting is %d'=>'設定できる最大値は%dです。','The maximum amount of memory (RAM) that your site can use at one time.'=>'サイトが一度に使用できるメモリ (RAM) 上限。','The maximum number of individual items this coupon can apply to when using product discounts. Leave blank to apply to all qualifying items in cart.'=>'割引にこのクーポンを適用できる個別項目の最大数。お買い物カゴ内のすべての対象項目に適用するには、空白のままにします。','The maximum number of variables your server can use for a single function to avoid overloads.'=>'過負荷を避けるための、サーバーが1つの関数に使用できる変数の最大数。','The maximum quantity allowed for this line item.'=>'この品目に認められている最高数量。','The maximum quantity of &quot;%1$s&quot; allowed in the cart is %2$s'=>'お買い物カゴに入れることができる「%1$s」の最大数量は%2$sです','The maximum quantity that can be added to the cart.'=>'お買い物