ows you to accept credit cards, debit cards, netbanking, wallet, and UPI payments.'=>'WooCommerce 公式の Razorpay 拡張により、クレジットカード、デビットカード、ネットバンキング、ウォレット、UPI 決済がご利用いただけます。','The options are &quot;Active&quot; (delivers payload), &quot;Paused&quot; (does not deliver), or &quot;Disabled&quot; (does not deliver due delivery failures).'=>'オプションは&quot;有効&quot; (配信する)、 &quot;一時停止&quot; (配信しない)、もしくは &quot;無効&quot; (配信失敗により配信しない)。','The Order Confirmation template serves as a receipt and confirmation of a successful purchase. It includes a summary of the ordered items, shipping, billing, and totals.'=>'注文確認テンプレートは正常に完了した購入手続きの領収書および確認書として使用できます。 注文された商品、配送、請求、合計に関する情報が含まれています。','The order details screen is easy to use.'=>'注文詳細画面が使いやすい。','The order details screen\'s functionality meets my needs.'=>'注文詳細画面の機能が自分のニーズに合っている。','The order has been received, but no payment has been made. Pending payment orders are generally awaiting customer action.'=>'この注文を受け付けましたが、支払いが行われていません。 支払い保留中の注文はほとんどの場合、顧客のアクションを待っています。','The order ID to process during checkout.'=>'購入手続き中に処理する注文番号。','The order ID.'=>'注文番号。','The order is awaiting payment confirmation. Stock is reduced, but you need to confirm payment.'=>'この注文は支払い確認待ちです。 在庫は減りましたが、支払いの確認を行う必要があります。','The order totals have been updated. Please confirm your order by pressing the "Place order" button at the bottom of the page.'=>'注文金額を更新しました。ページの下部にある注文ボタンを押して、注文を確認してください。','The order was canceled by an admin or the customer.'=>'注文は管理者または顧客によってキャンセルされました。','The organic coffee beans are a revelation. Each sip feels like a journey. Beautifully crafted accessories add a touch of elegance to my home.'=>'オーガニックコーヒー豆の新事実。 1口で旅行気分を味わえます。 優雅な雑貨でエレガントな自宅を演出。','The parent theme developers URL.'=>'親テーマ開発者の URL。','The patterns dictionary is missing.'=>'パターン辞書がありません。','The PayFast extension for WooCommerce enables you to accept payments by Credit Card and EFT via one of South Africa’s most popular payment gateways. No setup fees or monthly subscription costs