ere are no locations matching these parameters.'=>'これらの変数に一致する場所がありません。','There are no notes yet.'=>'まだ、取引メモがありません。','There are no orders to sync, aborting.'=>'同期する注文が見つからなかったため、中止しています。','There are no orders to verify, aborting.'=>'検証する注文が見つからなかったため、中止しています。','There are no product reviews yet.'=>'商品のレビューはまだありません。','There are no reviews yet.'=>'レビューはまだありません。','There are no shipping options available. Please ensure that your address has been entered correctly, or contact us if you need any help.'=>'利用できる配送方法がありません。住所が正しく入力されているか確認してください。もしくはお問い合わせください。','There are not enough %s in stock. Please reduce the quantities in your cart.'=>'%sの在庫が足りません。お買い物カゴ内の数量を減らしてください。','There are some issues with the items in your cart. Please go back to the cart page and resolve these issues before checking out.'=>'お買い物カゴ内の商品にエラーがあります。お買い物カゴページに戻り、エラーをご確認後、購入手続きにお進みください。','There are three ways to add your products: you can <strong>create products manually, import them at once via CSV file</strong>, or <strong>migrate them from another service</strong>.<br/><br/>'=>'商品は、<strong>手動による作成、CSV ファイルによる一括インポート</strong>、<strong>他のサービスからの移行</strong>の3つの方法で追加できます。<br/><br/>','There are too many %s in the cart. Only 1 can be purchased. Please reduce the quantity in your cart.'=>'お買い物カゴの %s の数量が多すぎます。 購入できるのは1点限りです。 お買い物カゴ内の数量を減らしてください。','There are too many %s in the cart. Only 1 of each can be purchased. Please reduce the quantities in your cart.'=>'お買い物カゴ内の%sの数量が多すぎます。購入できるのは1点限りです。 お買い物カゴ内の数量を減らしてください。','There are too many concurrent batches, but the run is forced to continue.'=>'同時実行バッチの数が多すぎますが、強制的に実行が続行されます。','There are too many concurrent batches.'=>'同時実行バッチの数が多すぎます。','There is %1$d order to be synced.'=>'同期する注文が%1$d件あります。' . "\0" . '','There is %1$d order to be verified.'=>'検証が必要な注文が%1$d件あります。' . "\0" . '','There is no data to export for the given request.'=>'リクエストに応じるためにエクスポートするデータがありません。','There is not enough %s in stock. Please reduce the quantity in your cart.'=>'%sの在庫が足りません。お買い物カゴ内の数量を減らしてください。','There was a failure fetching this action'=>'アクションの取得に失敗しました','There was a failure fetching this action: %s'=>'アクションの取得に失敗しました。%s','There was a failure scheduling the next instance of this action: %s'=>'この操作の次回のインスタンスの予約に失敗しました: %s','There was a problem activating some of the requested plugins.'=>'リクエストされたプラグインの一部で有効化に問題がありました。','There was a problem installing some of the requested plugins.'=>'リクエストされたプラグインの一部でインストールに問題がありました。','There was a problem with the provided %s:'=>'指定された%sに問題がありました:','There was a problem with the provided additional fields: %s is required'=>'入力した追加フィールドに問題がありました: %s は必須です','There was a problem with the provided billing address: %s is required'=>'入力した請求先住所に問題がありました: %s は必須です','There was a problem with the provided shipping address: %s is required'=>'入力した配送先住所に問題がありました: %s は必須です','There was an error activating this plugin.'=>'このプラグインの有効化でエラーが発生しました。','There was an error activating this theme.'=>'このテーマの有効化でエラーが発生しました。','There was an error calling %1$s: %2$s'=>'%1$s を呼び出す際にエラーが発生しました: %2$s','There was an error calling %s'=>' %s 呼び出し中にエラーが発生','There was an error calling this tool. There is no callback present.'=>'このツールの呼び出しでエラーが発生しました。コールバックはありません。','There was an error communicating with the WooPayments plugin.'=>'WooPayments プラグインとの通信中にエラーが発生しました。','There was an error connecting to Square.'=>'Square に接続しているときにエラーが発生しました。','There was an error connecting to WooCommerce.com. Please try again.'=>'WooCommerce.com への接続時にエラーが発生しました。もう一度お試しください。','There was an error connecting your subscription. Please try again.'=>'サブスクリプションの連携でエラーが発生しました。 もう一度お試しください。','There was an error deleting an action: %s'=>'アクションの削除中にエラーが発生しました: %s','There was an error disconnecting your subscription. Please try again.'=>'サブスクリプションの連携解除でエラーが発生しました。 もう一度お試しください。','There was an error generating your API Key.'=>'API キーの生成中にエラーが発生しました。','There was an error getting the install URL for this product.'=>'この製品のインストール URL を取得中にエラーが発生しました。','There was an error loading the WooCommerce.com Helper API.'=>'WooCommerce.com Helper API の読み込み時にエラーが発生しました。','There was an error processing your order. Please check for any charges in your payment method and review your <a href="%s">order history</a> before placing the order again.'=>'注文の処理中にエラーが発生しました。 再度ご注文される前に、現在のお支払い方法で請求がないかどうかを調べ、<a href="%s">ご注文履歴</a>をご確認ください。','There was an error running the action scheduler: %s'=>'アクションスケジューラの実行中にエラーが発生しました:%s','There was an error while processing your schema'=>'スキーマの処理中にエラーが発生しました','There was an error with an item in your cart.'=>'お買い物カゴ内のアイテムにエラーが生じました。','There was an issue loading the report endpoints'=>'レポートのエンドポイントの読み込み時に問題が発生しました。','There\'s %d webhook that is configured to be delivered using the Legacy REST API, which has been removed from WooCommerce. This webhook will fail to be sent.'=>'WooCommerce から削除されたレガシー REST API を配信に使用するように設定されている WebHook が%d件あります。 これらの WebHook は送信されません。' . "\0" . '','There\'s %s order pending sync.'=>'同期待ちの注文が%s件あります。' . "\0" . '','These account details will be displayed within the order thank you page and confirmation email.'=>'これらのアカウント詳細は注文サンキューページ内と確認メールに表示されます。','These costs can optionally be added based on the <a href="%s">product shipping class</a>.'=>'これらの費用は、必要に応じて<a href="%s">商品の配送クラス</a>に基づき追加することができます。','These costs can optionally be added based on the <a target="_blank" href="%s">product shipping class</a>. Learn more about <a target="_blank" href="https://woocommerce.com/document/flat-rate-shipping/#shipping-classes">setting shipping class costs</a>.'=>'この料金は<a target="_blank" href="%s">商品の配送クラス</a>に応じて、オプションで追加できます。 <a target="_blank" href="https://woocommerce.com/document/flat-rate-shipping/#shipping-classes">配送クラス料金の設定</a>について詳細をご確認ください。','These features are either experimental or incomplete, enable them at your own risk!'=>'これらの機能は試験用か不完全なため、ご自身の責任において有効にしてください。','These options let you change the appearance of the WooCommerce checkout.'=>'これらのオプションを使用すると、WooCommerce 購入画面の外観を変更することができます。','These pages need to be set so that WooCommerce knows where to send users to checkout.'=>'ユーザーが WooCommerce にて購入手続きを進めるために、以下の固定ページの設定が必要です。','These rates are extra shipping options with additional costs (based on the flat rate).'=>'これらの料金は(定額送料に基づいて)追加費用で別途送料オプションです。','These settings are not available while the lookup table regeneration is in progress.'=>'これらの設定は、ルックアップテーブルの再生成中は使用できません。','Thessaly'=>'テッサリア','Things to do next'=>'次の手順','This action appears to be consistently failing. A new instance will not be scheduled.'=>'このアクションは一貫して失敗しているようです。 新しいインスタンスは予約されません。','This action cannot be reversed. Are you sure you wish to erase personal data from the selected orders?'=>'この操作を元に戻すことはできません。選択した注文から個人情報データを消去してよいですか ?','This controls how stock quantities are displayed on the frontend.'=>'フロントエンドでの在庫数の表示方法を制御します。','This controls the description which the user sees during checkout.'=>'購入手続き時にユーザーが目にする説明をここで設定します。','This controls the position of the currency symbol.'=>'貨幣記号を表示する位置を設定します','This controls the title which the user sees during checkout.'=>'購入手続き時にユーザーが目にするタイトルをここで設定します。','This controls what currency prices are listed at in the catalog and which currency gateways will take payments in.'=>'どの通貨価格をカタログに適用するか、また、どの通貨を支払いに取り入れるかを設定します。','This controls what unit you will define lengths in.'=>'長さの定義','This controls what unit you will define weights in.'=>'単位設定','This controls which shipping address is used by default.'=>'デフォルトで使用するお届け先住所を指定します。','This coupon has expired.'=>'このクーポンは有効期限が切れています。','This coupon is password protected. WooCommerce does not support password protection for coupons. You can temporarily hide a coupon by making it private. Alternatively, usage limits and restrictions can be configured below.'=>'このクーポンはパスワードで保護されています。 WooCommerce はクーポンのパスワード保護をサポートしていません。 クーポンを非公開にすることで、一時的にクーポンを非表示にできます。 また、以下で利用制限や使用量の上限を設定することもできます。','This data will be deleted in %s.'=>'このデータは%sで削除されます。','This determines where log entries are saved.'=>'ログエントリーの保存場所を決定します。','This email address is already registered.'=>'このメールアドレスはすでに登録されています。','This feature is only available with the Cart & Checkout blocks. %1$sLearn more%2$s.'=>'この機能は、お買い物カゴおよび購入手続きブロックでのみ使用できます。 %1$s詳しくはこちらをご覧ください%2$s。','This field allows you to set the maximum spend (subtotal) allowed when using the coupon.'=>'このフィールドはクーポンを使う時に許容される値引き最大限度額を設定します。','This field allows you to set the minimum spend (subtotal) allowed to use the coupon.'=>'このフィールドでは、クーポンを使用するために必要な最小限度額を設定することができます。','This file does not exist.'=>'このファイルは存在しません。','This function should not be called before plugins_loaded.'=>'この関数は plugins_loaded より前に呼び出されるべきではありません。','This function should not be called before woocommerce_init.'=>'この関数は woocommerce_init の前に呼び出されるべきではありません。','This info will be displayed on the product page, category pages, social media, and search results.'=>'この情報は、商品ページ、カテゴリーページ、ソーシャルメディア、検索結果に表示されます。','This is a demo store for testing purposes &mdash; no orders shall be fulfilled.'=>'これはデモストアです &mdash; 注文は出来ません。','This is a featured product'=>'これは注目の商品です','This is an order notification sent to customers containing order details after an order is placed on-hold from Pending, Cancelled or Failed order status.'=>'注文が「承認待ち」、「キャンセル」、「失敗」の注文ステータスから保留にされた後、顧客に送信された注文の詳細を含む注文通知です。','This is an order notification sent to customers containing order details after payment.'=>'お支払い後、注文内容を記載してお客様に送信する注文通知書です。','This is not your download link.'=>'これはあなたのダウンロードリンクではありません。','This is the attachment ID, or image URL, used for placeholder images in the product catalog. Products with no image will use this.'=>'これは、商品カタログのプレースホルダー画像に使用される添付ファイル ID または画像 URL です。画像のない商品に使用されます。','This is the Customer Lifetime Value, or the total amount you have earned from this customer\'s orders.'=>'これは顧客生涯価値、つまりこの顧客の注文による売上の合計金額です。','This is the default category and it cannot be deleted. It will be automatically assigned to products with no category.'=>'これはデフォルトのカテゴリーで、削除できません。カテゴリーなしの商品に自動的に割り当てられます。','This is the name of the download shown to the customer.'=>'顧客向けのダウンロードの名前です。','This is the sum of the "Tax rows" shipping tax amount within your orders.'=>'ご注文内の「税行」の送料税額の合計です。','This is the sum of the "Tax rows" tax amount within your orders.'=>'ご注文内の「税行」の税額の合計です。','This is the sum of the \'Order total\' field within your orders.'=>'注文内の「注文総額」フィールドの合計です。','This is the sum of the \'Shipping total\' field within your orders.'=>'注文内の「送料総額」フィールドの合計です。','This is the sum of the order totals after any refunds and excluding shipping and taxes.'=>'これは送料や税金を抜いた、払い戻しを抜いた売り上げの合計です。','This is the sum of the order totals after any refunds and including shipping and taxes.'=>'これは送料や税金を含めて、払い戻しを抜いた売り上げの合計です。','This is the total tax for the rate (shipping tax + product tax).'=>'これは税金の合計です。(送料税＋商品代金税)','This is the URL or absolute path to the file which customers will get access to. URLs entered here should already be encoded.'=>'これは、顧客が受け取るファイルのURLもしくは絶対パスです。ここで入力するURLは、エンコードしてください。','This is the WooCommerce shop page. The shop page is a special archive that lists your products. <a href="%s">You can read more about this here</a>.'=>'これは WooCommerce のショップページです。ショップページは、商品をリストする特殊な保管場所です。<a href="%s">詳細については、ここを参照してください</a>。','This is where store orders are stored.'=>'店舗の受注が保存される場所です','This is where you can add new coupons that customers can use in your store.'=>'顧客が店舗で使用できるクーポンを、新規に追加できる場所です。','This is where you can browse products in this store.'=>'こちらからこのストアの商品を閲覧できます。','This is where you can set up product forms for various product types in your dashboard.'=>'ここで、ダッシュボード内のさまざまな商品タイプの商品フォームを設定できます。','This is where your business is located. Tax rates and shipping rates will use this address.'=>'店舗がある場所です。税金と送料はこの住所を使用します。','This key is invalid or has already been used. Please reset your password again if needed.'=>'このキーは無効であるか、すでに使用されています。必要に応じて、もう一度パスワードをリセットしてください。','This lets you choose which products are part of this group.'=>'これにより、このグループに含める商品を選択できます。','This means that the table is probably in an inconsistent state. It\'s recommended to run a new regeneration process or to resume the aborted process (Status - Tools - Regenerate the product attributes lookup table/Resume the product attributes lookup table regeneration) before enabling the table usage.'=>'これは、テーブルが不整合な状態にある可能性を意味します。 テーブルの使用を有効化する前に、新しい再生成プロセスを実行するか、中止されたプロセスを再開 (ステータス - ツール - 商品属性ルックアップテーブルを再生成 / 商品属性ルックアップテーブルの再生成を再開) することをおすすめします。','This method has been deprecated and will be removed soon. Use Automattic\\WooCommerce\\Utilities\\DiscountsUtil::is_coupon_emails_allowed instead.'=>'この方法は非推奨であり、まもなく削除される予定です。 代わりに Automattic\\WooCommerce\\Utilities\\DiscountsUtil::is_coupon_emails_allowed を使用してください。','This method is deprecated in 2.6.0 and will be removed in future versions - we recommend disabling it and instead setting up a new rate within your <a href="%s">Shipping zones</a>.'=>'この方法は、2.6.0で廃止され、将来のバージョンで削除されます - これを無効にし、代わりにあなたの<a href="%s">配送地域</a>の新しいレートを設定することをおすすめします。','This method should not be called before plugins_loaded.'=>'このメソッドは plugins_loaded より前に呼び出されるべきではありません。','This month'=>'今月','This option determines a customers default location. The MaxMind GeoLite Database will be periodically downloaded to your wp-content directory if using geolocation.'=>'このオプションは、顧客のデフォルトの場所を決定します。ジオロケーションを使用している場合 MaxMind GeoLite データベースは定期的にあなたの wp-content ディレクトリにダウンロードされます。','This option determines which address is used to calculate tax.'=>'このオプションは、税計算を適用する場所 (住所) を決定します。','This option is important as it will affect how you input prices. Changing it will not update existing products.'=>'このオプションは重要です。あなたがどのように価格を入力するかに影響します。変更すると、既存商品を更新しません。','This option lets you limit which countries you are willing to sell to.'=>'このオプションで販売先の国を制限できます。','This option will delete ALL of your tax rates, use with caution. This action cannot be reversed.'=>'このオプションを選択するとすべての税率が削除されるため、注意して使用してください。この操作は元に戻すことはできません。','This order belongs to a different customer.'=>'この注文は別の顧客のものです。','This order cannot be paid for.'=>'このご注文に対する支払いはできません。','This order cannot be paid for. Please contact us if you need assistance.'=>'このご注文に対する支払いはできません。サポートが必要な場合は、お問い合わせください。','This order is already linked to a user account.'=>'この注文はすでにユーザーアカウントにリンクされています。','This order is no longer editable.'=>'この注文は現在編集できません。','This order&rsquo;s status is &ldquo;%s&rdquo;&mdash;it cannot be paid for. Please contact us if you need assistance.'=>'この注文&rsquo;s 状況は &ldquo;%s&rdquo;&mdash;支払いが出来ません。必要があればご連絡ください。','This page\'s content is overridden by custom template content'=>'このページのコンテンツはカスタムテンプレートのコンテンツによって上書きされます','This password reset key is for a different user account. Please log out and try again.'=>'このパスワードリセットキーは、別のユーザーアカウント用です。 ログアウトして再試行してください。','This payment method was successfully set as your default.'=>'この決済方法を標準に設定しました。','This plugin can no longer be activated because its functionality is now included in <strong>WooCommerce</strong>. It is recommended to <strong>delete</strong> it.'=>'このプラグインの機能は <strong>WooCommerce</strong> に含まれているため、有効化できなくなりました。 <strong>削除</strong>することをおすすめします。','This plugin cannot be activated because its functionality is now included in WooCommerce core.'=>'このプラグインの機能は WooCommerce コアに含まれているため、有効化できません。','This product cannot be added to the cart.'=>'この商品はお買い物カゴに追加できません。','This product has been activated.'=>'この製品が有効化されました。','This product has multiple variants. The options may be chosen on the product page'=>'この商品には複数のバリエーションがあります。 オプションは商品ページから選択できます','This product has options, such as size or color. You can manage each variation\'s images, downloads, and other details individually.'=>'この商品にはサイズや色などのオプションがあります。 各バリエーションの画像、ダウンロード、その他の詳細を個別に管理できます。','This product has options, such as size or color. You can now manage each variation\'s inventory and other details individually.'=>'この商品にはサイズや色などのオプションがあります。 各バリエーションの在庫やその他の詳細を個別に管理できるようになりました。','This product has options, such as size or color. You can now manage each variation\'s shipping settings and other details individually.'=>'この商品にはサイズや色などのオプションがあります。 各バリエーションの配送設定やその他の詳細を個別に管理できるようになりました。','This product has produced sales and may be linked to existing orders. Are you sure you want to delete it?'=>'この商品は販売を行っており、既存の注文とリンクしている可能性があります。削除してもよろしいですか ?','This product is already active.'=>'この製品はすでに有効化されています。','This product is already installed.'=>'この製品はすでにインストールされています。','This product is currently out of stock and unavailable.'=>'現在この商品は在庫切れのため、ご利用いただけません。','This product is not installed.'=>'この製品はインストールされていません。','This product is protected and cannot be purchased.'=>'この商品は保護されているため、ご購入いただけません。','This product requires shipping or pickup'=>'この商品は配送または店頭渡しをする必要があります','This product will not trigger your customer\'s shipping calculator in cart or at checkout. This product also won\'t require your customers to enter their shipping details at checkout. <a href="https://woocommerce.com/document/managing-products/#adding-a-virtual-product" target="_blank" rel="noreferrer">Read more about virtual products</a>.'=>'この商品では顧客のお買い物カゴまたは購入手続き時に、送料計算機はトリガーされません。 また、この商品では顧客は購入手続き時にお届け先詳細の入力を求められません。 <a href="https://woocommerce.com/document/managing-products/#adding-a-virtual-product" target="_blank" rel="noreferrer">バーチャル商品について詳細をご覧ください</a>。','This report link has expired. %1$sClick here to view the filtered report%2$s.'=>'このレポートリンクは有効期限切れです。%1$sクリックして、フィルタリング済みレポートを表示%2$s。','This resource cannot be created.'=>'このリソースは作成できません。','This sample language includes the basics around what personal data your store may be collecting, storing and sharing, as well as who may have access to that data. Depending on what settings are enabled and which additional plugins are used, the specific information shared by your store will vary. We recommend consulting with a lawyer when deciding what information to disclose on your privacy policy.'=>'この例文には、ストアが収集、保管、共有する可能性のある個人データに関する基本的な情報と、そのデータにアクセスできる関係者が記載されています。有効な設定や追加で使用されるプラグインによって、ストアで共有する具体的な情報は異なります。個人情報保護方針で公開する情報を決定する際は、弁護士に相談することをおすすめします。','This section controls the display of your website privacy policy. The privacy notices below will not show up unless a %s is set.'=>'このセクションでは、ウェブサイトプライバシーポリシーの表示方法をコントロールします。 以下のプライバシー通知は、%sがまず設定されないと表示されません。','This section lets you customize the WooCommerce emails. <a href="%s" target="_blank">Click here to preview your email template</a>.'=>'WooCommerce メールをカスタマイズするセクションです。<a href="%s" target="_blank">クリックしてメールテンプレートをプレビュー</a>してください。','This section shows any files that are overriding the default WooCommerce template pages.'=>'上書きする標準の WooCommerce テンプレートページを表示する。','This section shows details of Action Scheduler.'=>'このセクションにはアクションスケジューラーの詳細が表示されます。','This section shows details of WC Admin.'=>'このオプションを選択すると、WC Admin の詳細が表示されます。','This section shows information about this status report.'=>'このセクションでは、このステータスレポートについての情報を表示します。','This sets how many days log entries will be kept before being auto-deleted.'=>'ログエントリーを自動削除まで保持する日数を設定します。','This sets the base page of your shop - this is where your product archive will be.'=>'ショップ基本ページを設定します。商品が保存される場所です。','This sets the decimal separator of displayed prices.'=>'表示価格の小数点区切り文字を設定します。','This sets the minimum severity level of logs that will be stored. Lower severity levels will be ignored. "None" means all logs will be stored.'=>'保存されるログの最小重大度レベルを設定します。 これより低い重大度レベルは無視されます。 「なし」の場合はすべてのログが保存されます。','This sets the number of decimal points shown in displayed prices.'=>'表示価格の小数点以下の表示桁数を設定します。','This sets the thousand separator of displayed prices.'=>'表示価格の千単位の区切り文字を設定します。','This setting cannot be changed here because it is being set by a filter on the %s hook.'=>'この設定は %s フックのフィルターで設定されているため、ここで変更することはできません。','This setting cannot be changed here because it is defined in the %1$s constant, probably in your %2$s file.'=>'この設定はファイル %2$s にあると考えられる定数 %1$s で定義されているため、ここで変更することはできません。','This setting cannot be changed here because it is defined in the %s constant.'=>'この設定は定数 %s で定義されているため、ここで変更することはできません。','This setting determines which shop pages products will be listed on.'=>'この設定は、商品が掲載されるショップページを決定します。','This setting does not apply to guest purchases.'=>'この設定は、ゲストでの購入には適用されません。','This setting only works when product data is stored in the posts table.'=>'この設定は、商品データが投稿テーブルに保存されている場合にのみ機能します。','This shipping method does not have any settings to configure.'=>'配送方法に登録するべき設定はありません。','This subscription has expired. Contact the owner to <strong>renew</strong> the subscription to receive updates and support.'=>'この定期購入は有効期限切れです。<strong> 更新</strong>およびサポートを受けるために、定期購入を更新するには所有者に連絡してください。','This subscription has expired. Please <strong>renew</strong> to receive updates and support.'=>'この定期購入は有効期限切れです。アップデートとサポートを受けるには<strong>更新</strong>してください。','This subscription is expiring soon. Please <strong>renew</strong> to continue receiving updates and support.'=>'この定期購入は間もなく終了します。アップデートとサポートを引き続き受けるために<strong>更新</strong>してください。','This template has been overridden by your theme and can be found in: %s.'=>'このテンプレートはご利用中のテーマによって上書きされており、次の場所にあります: %s','This text will be shown on the button linking to the external product.'=>'このテキストは外部商品のリンクボタンに表示されます','This tool allows you to generate and download a CSV file containing a list of all products.'=>'このツールを使用すると、すべての商品のリストを含む CSV ファイルを生成してダウンロードすることができます。','This tool allows you to import (or merge) product data to your store from a CSV or TXT file.'=>'このツールを使用することで、CSV または TXT ファイルのデータをストアにインポート (またはマージ) できます。','This tool will abort the regenerate product attributes lookup table regeneration. After this is done the process can be either started over, or resumed to continue where it stopped.'=>'このツールによって、商品属性ルックアップテーブルの再生成が中止されます。 この処理が完了すると、プロセスを最初からやり直すことも、停止した時点から再開することもできます。','This tool will clear ALL expired transients from WordPress.'=>'このツールはすべての期限切れのトランジェントをWordPressからクリアします。','This tool will clear the data from legacy order tables in WooCommerce.'=>'このツールは WooCommerce にあるレガシーの注文表からデータを消去します。','This tool will clear the product/shop transients cache.'=>'このツールは、「商品」と「ショップ」のトランジェットのキャッシュをクリアします。','This tool will delete all customer session data from the database, including current carts and saved carts in the database.'=>'このツールは、現在お買い物カゴに入っているものとデータベースに保存されているお買い物カゴも含め、すべての顧客セッションデータをデータベースから削除します。','This tool will delete all variations which have no parent.'=>'このツールは、親が存在しないすべてのバリエーションを削除します。','This tool will delete expired download permissions and permissions with 0 remaining downloads.'=>'このツールにより、有効期限が切れたダウンロード権限と、残りのダウンロード数が0になっている権限が削除されます。','This tool will empty the system status theme info cache.'=>'このツールは、システムステータステーマ情報キャッシュを空にします。','This tool will empty the template cache.'=>'このツールがテンプレートキャッシュを空にします。','This tool will install all the missing WooCommerce pages. Pages already defined and set up will not be replaced.'=>'このツールは欠落しているすべての WooCommerce ページをインストールします。ページはすでに定義済みです。設定は置き換えられません。','This tool will recount product terms - useful when changing your settings in a way which hides products from the catalog.'=>'このツールは、商品項目を再集計します。- カタログから商品を隠す設定に変更したとき役立ちます。','This tool will recreate the full text search index for order addresses. If the index does not exist, it will try to create it.'=>'このツールは注文住所の全文検索インデックスを再作成します。 インデックスが存在しない場合は、作成が試行されます。','This tool will regenerate product lookup table data. This process may take a while.'=>'このツールで商品ルックアップテーブルデータを再生成します。この処理はしばらくかかる場合があります。','This tool will regenerate the product attributes lookup table data from existing product(s) data. This process may take a while.'=>'このツールでは、既存の商品データから商品属性ルックアップテーブルのデータを再生成します。 この処理はしばらくかかる場合があります。','This tool will reset the admin, customer and shop_manager roles to default. Use this if your users cannot access all of the WooCommerce admin pages.'=>'このツールはデフォルトで、「顧客」と「shop_manager」の権限を管理者がリセット出来るようになっています。ユーザーがすべての WooCommerce 管理ページにアクセスできない場合に使用します。','This tool will reset the cached values used in WooCommerce Analytics. If numbers still look off, try %1$sReimporting Historical Data%2$s.'=>'このツールは、WooCommerce Analytics で使用されたキャッシュ済みの値をリセットします。 それでも数値が不足している場合は、%1$s履歴データの再インポート%2$sをお試しください。','This tool will resume the product attributes lookup table regeneration at the point in which it was aborted (%1$s products were already processed).'=>'このツールによって、中止された時点から商品属性ルックアップテーブルの再生成が再開されます (%1$s個の商品が処理済み)。','This tool will update your WooCommerce database to the latest version. Please ensure you make sufficient backups before proceeding.'=>'このツールは WooCommerce データベースを最新のバージョンに更新します。次に進む前に、十分なバックアップを取ってください。','This variation requires shipping or pickup'=>'このバリエーションは配送または店頭渡しをする必要があります','This variation will not trigger your customer\'s shipping calculator in cart or at checkout. This product also won\'t require your customers to enter their shipping details at checkout. <a href="https://woocommerce.com/document/managing-products/#adding-a-virtual-product" target="_blank" rel="noreferrer">Read more about virtual products</a>.'=>'このバリエーションでは顧客のお買い物カゴまたは購入手続き時に、送料計算機はトリガーされません。 また、この商品では顧客は購入手続き時にお届け先詳細の入力を求められません。 <a href="https://woocommerce.com/document/managing-products/#adding-a-virtual-product" target="_blank" rel="noreferrer">バーチャル商品について詳細をご覧ください</a>。','This video tutorial will help you go through the process of adding your first product in WooCommerce.'=>'この動画チュートリアルでは、WooCommerce に最初の商品を追加するプロセス全体を確認できます。','This webhook has the ⚠️ symbol in front of its name in the list below. Please either edit the webhook to use a different delivery format, or install and activate <a href="%s" target="_blank">the WooCommerce Legacy REST API extension</a>.'=>'これらの WebHook は、次のリストで名前の前に ⚠️ マークが付いています。 WebHook を編集して別の配信形式を使用するか、<a href="%s" target="_blank">WooCommerce レガシー REST API 拡張機能</a>をインストールして有効にしてください。' . "\0" . '','This webhook is configured to be delivered using the Legacy REST API, but the Legacy REST API plugin is not installed on this site.'=>'この WebHook はレガシー REST API を使用して配信されるように設定されていますが、サイトにレガシー REST API プラグインがインストールされていません。','This will be how your name will be displayed in the account section and in reviews'=>'アカウントセクションとレビューではこの名前が表示されます','This will change the stock status of all variations.'=>'これにより、すべてのバリエーションの在庫状況が変更されます。','This will convert <code>coupon_data</code> order item meta entries to simplified <code>coupon_info</code> entries. The conversion will happen overtime in the background (via Action Scheduler). There are currently %d entries that can be converted.'=>'これは <code>coupon_data</code> 注文アイテムメタ情報エントリーを簡素な <code>coupon_info</code> エントリーに変換します。 変換はバックグラウンドで時間と共に実行されます (アクションスケジューラー経由で)。 変換可能なエントリーは現在%d件あります。','This will convert <code>coupon_data</code> order item meta entries to simplified <code>coupon_info</code> entries. The conversion will happen overtime in the background (via Action Scheduler). There are currently no entries to convert.'=>'これは <code>coupon_data</code> 注文アイテムメタ情報エントリーを簡素な <code>coupon_info</code> エントリーに変換します。 変換はバックグラウンドで時間と共に実行されます (アクションスケジューラー経由で)。 変換可能なエントリーは現在ありません。','This will delete an inbox notification by slug'=>'これにより、受信箱の通知がスラッグによって削除されます','This will delete the custom orders tables. The tables can be deleted only if the "High-Performance order storage" is not authoritative and sync is disabled (via Settings > Advanced > Features).'=>'これにより、カスタム注文テーブルが削除されます。 テーブルを削除するには、「高パフォーマンス注文ストレージ」が主要タイプになっておらず、同期が無効になっている必要があります (「設定」>「高度な設定」>「機能」)。','This will delete the custom orders tables. To create them again enable the "High-Performance order storage" feature (via Settings > Advanced > Features).'=>'これにより、カスタムの注文表が削除されます。 再度作成する場合は、「高パフォーマンス注文ストレージ」を有効化します (「設定」>「高度な設定」>「機能」)。','This will give "%1$s" %2$s access which will allow it to:'=>'これにより、以下を実行できる %2$s アクセスが「%1$s」に付与されます:','This will refresh the remote inbox notifications'=>'これによりリモート受信箱の通知が更新されます','This will regenerate all shop thumbnails to match your theme and/or image settings.'=>'これにより、すべてのショップのサムネイルが再生成され、テーマや画像の設定が反映されます。','This will stop the background process that converts <code>coupon_data</code> order item meta entries to simplified <code>coupon_info</code> entries. There are currently %d entries that can be converted.'=>'これにより、<code>coupon_data</code> 注文アイテムメタ情報エントリーを簡素な <code>coupon_info</code> エントリーに変換するバックグラウンド処理が停止します。 変換可能なエントリーは現在%d件あります。','Thiès'=>'ティエス','Thousand separator'=>'3桁ごとの区切り文字','Thousand separator for the currency which can be used to format returned prices.'=>'返される価格用の通貨フォーマットの桁区切り文字。','Thousand separator.'=>'1000の区切り記号。','Thousands separator for displayed prices in this country.'=>'この国の表示価格に使用される3桁区切り文字。','Thumbnail'=>'サムネイル','Thumbnail cropping'=>'サムネイルの切り取り','Thumbnail image'=>'サムネイル画像','Thumbnail regeneration has been scheduled to run in the background.'=>'サムネイルの再生成は、バックグラウンドで実行するようにスケジュールされています。','Thumbnail regeneration is running in the background. Depending on the amount of images in your store this may take a while.'=>'サムネイルの再生成はバックグラウンドで実行されています。店舗内の画像の量によっては、時間がかかることがあります。','Thumbnail sizes for responsive images.'=>'レスポンシブ画像のサムネイル sizes。','Thumbnail srcset for responsive images.'=>'レスポンシブ画像のサムネイル srcset。','Thumbnail URL.'=>'サムネイル URL。','Thumbnail width'=>'サムネイルの幅','Thurgau'=>'トゥールガウ','Thuringia'=>'テューリンゲン','Tianjin / 天津'=>'ティエンジン / 天津','Tiaret'=>'ティアレット','Tibet / 西藏'=>'チベット / 西藏','Ticino'=>'ティチーノ','Tierra del Fuego'=>'ティエラ・デル・フエゴ','TikTok for WooCommerce'=>'TikTok for WooCommerce','Time interval to use for buckets in the returned data.'=>'時間間隔は返されるデータでバケットのために使用されます。','Time period to snooze the task.'=>'タスクを再通知する期間。','Timeless elegance'=>'時空を超えたエレガンス','Timestamp'=>'タイムスタンプ','Timiș'=>'ティミシュ','Timor-Leste'=>'東ティモール','Tindouf'=>'ティンドーフ','Tinghir'=>'ティネリール','Tip: By suggesting complementary products in the cart using cross-sells, you can significantly increase the average order value.'=>'ヒント: クロスセルを使ってお買い物カゴの商品の関連商品をおすすめすると、平均注文金額を大幅に増やすことができます。','Tip: Upsells are products that are extra profitable or better quality or more expensive. Experiment with combinations to boost sales.'=>'ヒント: アップセルとは、収益性、品質、または価格がより高い商品をいいます。 さまざまな組み合わせを試して売上を伸ばしましょう。','Tipasa'=>'ティパザ','Tipperary'=>'ティペラリー','Tirana'=>'ティラナ','Tissemsilt'=>'ティスムシルト','Title'=>'タイトル','Title of the marketing campaign.'=>'マーケティングキャンペーンのタイトル。','Title of the note.'=>'メモのタイトル。','Title:'=>'タイトル:','Tizi Ouzou'=>'ティージー・ウズー','Tiznit'=>'ティズニット','Tlaxcala'=>'トラスカラ','Tlemcen'=>'トレムセン','To allow logging, make %s writable.'=>'ロギングを許可するには %s を書き込み可能にします。','To connect to %1$s you need to be logged in. Log in to your store below, or <a href="%2$s">cancel and return to %1$s</a>'=>'%1$s と連携するにはログインが必要です。以下からログインするか、<a href="%2$s">キャンセルして %1$s に戻ってください</a>','To edit this order change the status back to "Pending payment"'=>'この注文を「支払い待ち」に戻す変更をする','To enable this update you need to <strong>activate</strong> this subscription.'=>'この更新を有効にするには、この定期購入を<strong>有効化</strong>する必要があります。','To enable this update you need to <strong>purchase</strong> a new subscription.'=>'この更新を有効にするには、定期購入を新しく<strong>購入</strong>する必要があります。','To ensure your store&rsquo;s notifications arrive in your and your customers&rsquo; inboxes, we recommend connecting your email address to your domain and setting up a dedicated SMTP server. If something doesn&rsquo;t seem to be sending correctly, install the <a href="%1$s">WP Mail Logging Plugin</a> or check the <a href="%2$s">Email FAQ page</a>.'=>'ストアの通知が自分と顧客の受信トレイに確実に届くようにするには、メールアドレスをドメインに接続し、専用の SMTP サーバーを設定することをお勧めします。 正しく送信されていないメッセージがあると思われる場合は、<a href="%1$s">WP Mail Logging Plugin</a> をインストールするか、<a href="%2$s">メールに関するよくある質問のページ</a>を確認してください。','To make sure you never get that sinking "what did I forget" feeling, we\'ve put together the essential pre-launch checklist.'=>'設定忘れがないよう、公開前のチェックリストをご用意しました。','To manipulate product variations you should use the /products/&lt;product_id&gt;/variations/&lt;id&gt; endpoint.'=>'商品のバリエーションを操作するには /products/&lt;product_id&gt;/variations/&lt;id&gt; エンドポイントを使用してください。','To opt out, leave this box unticked. Your store remains untracked, and no data will be collected. Read about what usage data is tracked at: %s.'=>'無効にするには、このボックスにはチェックマークを入れないでください。ストアにチェックマークが入っていないため、データは収集されません。使用状況に関するどのようなデータが追跡されるかについては、%s を参照して