ntegrate with third-party services which support them.'=>'Webhooks は、あなたが選択した URL に送信されるイベント通知です。それらは、それらをサポートするサードパーティのサービスと統合するために使用できます。','Webhooks do not support trashing.'=>'Webhooks はゴミ箱機能がありません。','Week(s)'=>'週','Weight'=>'重さ','Weight (%s)'=>'重量 (%s)','Weight in decimal form'=>'10進表記の重量','Weight unit'=>'重量単位','Welcome to'=>'ようこそ','Welcome to the store'=>'ストアへようこそ','Welcome to {site_title}'=>'ようこそ {site_title} へ','Wellington'=>'ウェリントン','West African CFA franc'=>'西アフリカ CFA フラン','West Azarbaijan (آذربایجان غربی)'=>'西アーザルバーイジャーン (آذربایجان غربی)','West Bengal'=>'西ベンガル州','West Coast'=>'ウェストコースト','West Greece'=>'西ギリシャ','West Macedonia'=>'西マケドニア','West Panamá'=>'西パナマ','West Pokot'=>'ウェストポーコット','West Virginia'=>'ウェストバージニア州','Western'=>'西','Western Australia'=>'西オーストラリア州','Western Cape'=>'西ケープ州','Western North'=>'ウエスタンノース','Western Sahara'=>'西サハラ','Westmeath'=>'ウェストミーズ','Westmoreland'=>'ウェストモーランド','Wexford'=>'ウェックスフォード','We’ll also use cookies to keep track of cart contents while you’re browsing our site.'=>'当社では、サイトの閲覧中にお買い物カゴの内容を追跡するために Cookie も使用しています。','What currency do you accept payments in?'=>'どの通貨で支払いを受け取りますか ?','What currency prices are listed at in the catalog and which currency gateways will take payments in.'=>'カタログに表示される価格の通貨と支払いの時に使う通貨。','What fee do you want to charge for local delivery, disregarded if you choose free. Leave blank to disable.'=>'現地配送に追加する手数料。無料選択時は無視されます。無効にするには空白にします。','What is PayPal?'=>'PayPal (ペイパル) とは','What makes this product unique? What are its most important features? Enrich the product page by adding rich content using blocks.'=>'この商品の特徴は何ですか ? 最も重要な機能は何ですか ? ブロックを使用してリッチコンテンツを追加すると、商品ページを充実させることができます。','What our customers say'=>'お客様の声','What running the tool will do.'=>'ツールが実行する処理内容。','What type of products do you plan to sell?'=>'どんな商品の販売を検討してますか ?','What we collect and store'=>'収集して保管する情報','What we share with others'=>'当社が関係者と共有する情報','What would you like to charge for flat rate shipping?'=>'一律送料には何を含めますか。','What ZIP/post codes are available for local delivery?'=>'現地配送に使用する郵便番号','What ZIP/post codes are available for local pickup?'=>'商品受け取りに使用する郵便番号','When applying multiple coupons, apply the first coupon to the full price and the second coupon to the discounted price and so on.'=>'複数のクーポンを適用する場合、最初のクーポンをすべての価格に適用し、第二のクーポンは割引された価格などに適用されます。','When checked, customers will be able to purchase only 1 item in a single order. This is particularly useful for items that have limited quantity, like art or handmade goods.'=>'オンにすると、1回の注文につき1商品に購入が制限されます。 アートやハンドメイドグッズなど、数量が限られている商品で特に役に立ちます。','When handling an %s, should access to downloadable files be revoked and download logs cleared?'=>'%sを処理する場合、ダウンロード可能なファイルにアクセスして取り消し、ダウンロードログをクリアする必要がありますか ?','When handling an %s, should personal data within orders be retained or removed?'=>'%sを処理する場合、注文内の個人データを保持または削除する必要がありますか ?','When limiting response using after/before, which date column to compare against.'=>'より後 / より前を使用して応答を制限する場合、どの日付カラムを基準にするか。','When out of stock'=>'在庫切れになった時点','When product stock reaches this amount the stock status will change to "out of stock" and you will be notified via email. This setting does not affect existing "in stock" products.'=>'商品の在庫数がこの量に達すると、在庫状況は「在庫不足」に変更され、メールを介して通知されます。この設定は既存の「在庫」商品には影響しません。','When product stock reaches this amount you will be notified by email. It is possible to define different values for each variation individually. The shop default value can be set in Settings > Products > Inventory.'=>'商品の在庫数がこの数量に達すると、メールにより通知が届きます. It is possible to define different values for each variation individually. The shop default value can be set in Settings >「商品」>「在庫」。','When product stock reaches this amount you will be notified via email.'=>'商品の在庫数がこの量に達すると、メールを介して通知されます。','When true, email a link to download the export to the requesting user.'=>'条件を満たす場合、リクエストしているユーザーにダウンロード用リンクをメールします。','When true, refunded items are restocked.'=>'true の場合、払い戻されたアイテムは在庫に戻ります。','When true, the payment gateway API is used to generate the refund.'=>'true の場合、払い戻しを生成するために支払いゲートウェイ API が使用されます。','When variation stock reaches this amount you will be notified by email. The default value for all variations can be set in the product Inventory tab. The shop default value can be set in Settings > Products > Inventory.'=>'バリエーションの在庫数がこの数量に達すると、メールにより通知が届きます. The default value for all variations can be set in the product Inventory tab. The shop default value can be set in Settings > 「商品」>「在庫」。','When viewing a brand archive, show the current brands description.'=>'ブランドのアーカイブを表示する際、現在のブランドの説明を表示させます。','When you purchase from us, we’ll ask you to provide information including your name, billing address, shipping address, email address, phone number, credit card/payment details and optional account information like username and password. We’ll use this information for purposes, such as, to:'=>'当サイトから購入される際、お客様の名前、請求先住所、お届け先住所、メールアドレス、電話番号、クレジットカード/支払い情報と、必要に応じてアカウント情報 (ユーザー名とパスワードなど) を提供していただきます。この情報を使用する目的には、以下が含まれます。','When you receive a new order, it will appear here.'=>'新規注文を受け取った際、ここに表示されます。','Where is your store based?'=>'店舗地域 (国)','Whether an order can be edited.'=>'注文が編集可能かどうか。','Whether an order needs payment, based on status and order total.'=>'ステータスと注文合計に基づいて注文の決済が必要かどうか。','Whether an order needs processing before it can be completed.'=>'完了前に注文の処理が必要かどうか。','Whether or not a user can request to be reminded about the note.'=>'ユーザーがメモに関するリマインドをリクエストできるかどうか。','Whether or not plugins step in core profiler was skipped.'=>'コアプロファイラーのプラグインステップがスキップされたかどうか。','Whether or not the marketing channel is set up.'=>'マーケティングチャネルが設定されているかどうか。','Whether or not the profile was completed.'=>'プロフィールの完成・未完成の別。','Whether or not the profile was skipped.'=>'プロフィールがスキップされたかどうか。','Whether or not the store was connected to WooCommerce.com during the extension flow.'=>'拡張機能の実行中にストアが WooCommerce.com に連携されていたかどうか。','Whether or not this is a compound rate.'=>'どうであろうと、これが混合率です。','Whether or not this store agreed to receiving marketing contents from WooCommerce.com.'=>'このストアが WooCommerce.com からのマーケティングコンテンツの受信に同意しているかどうか。','Whether or not this store country is set via onboarding profiler.'=>'このストアの国名がオンボーディングプロファイラーで設定されているかどうか。','Whether or not this store was setup for a client.'=>'このストアが顧客向けにセットアップされたかどうか。','Whether or not this tax rate also gets applied to shipping.'=>'どうであろうと、この税率も出荷に適用されます。','Whether or not you have WordPress Multisite enabled.'=>'WordPress マルチサイトを有効化しているかどうか。','Whether the coupon grants free shipping or not.'=>'グーポンにより無料配送が提供されるかどうか。','Whether the plugin can only be activated network-wide.'=>'プラグインがサイトネットワーク全体のみで有効化できるかどうか。','Whether the product being updated is the last one in the loop'=>'更新中の商品がループ内の最後の商品であるかどうか','Whether the product is visible in the catalog'=>'商品がカタログに表示されているかどうか','Whether to bypass trash and force deletion.'=>'ゴミ箱に入れずに強制的に削除するかどうか。','Whether to consider GMT post dates when limiting response by published or modified date.'=>'投稿日または変更日に基づきレスポンスを限定する際に、グリニッジ標準時の投稿日を考慮するかどうか。','Whether to create a new user account as part of order processing.'=>'注文処理の過程で新しいユーザーアカウントを作成するかどうか。','Whether to hide resources not assigned to any products.'=>'いずれの商品にも割り当てられていないリソースを非表示にするかどうか。','Which columns should be exported?'=>'どの列をエクスポートしますか ?','Which features are disabled?'=>'どの機能が無効になっていますか ?','Which features are enabled?'=>'どの機能が有効になっていますか ?','Which product category should be exported?'=>'どの商品カテゴリーをエクスポートしますか ?','Which product types should be exported?'=>'どの商品タイプをエクスポートしますか ?','While you visit our site, we’ll track:'=>'サイト訪問中は、以下の情報を追跡します。','Who on our team has access'=>'情報にアクセスできるチームメンバー','Wicklow'=>'ウィックロー','Width'=>'幅','Width (%s)'=>'幅 (%s)','Wisconsin'=>'ウィスコンシン州','With a wide range of designer chairs to elevate your living space.'=>'リビング空間をランクアップするデザイナーズチェアを豊富に取り揃えています。','with first and last resultShowing %1$d&ndash;%2$d of %3$d result'=>'結果の%1$d～%2$d/%3$dを表示しています' . "\0" . '','With our blocks, you can select and display products, categories, filters, and more virtually anywhere on your site — no need to use shortcodes or edit lines of code. Learn more about how to use each one of them.'=>'ブロックを使用すると、商品、カテゴリー、フィルターなどをサイト上のどこでも選択、表示できます。ショートコードを使用したり、コードを編集したりする必要はありません。 各ブロックの使用方法を参照してください。','With the release of WooCommerce 4.0, these reports are being replaced. There is a new and better Analytics section available for users running WordPress 5.3+. Head on over to the <a href="%1$s">WooCommerce Analytics</a> or learn more about the new experience in the <a href="https://woocommerce.com/document/woocommerce-analytics/" target="_blank">WooCommerce Analytics documentation</a>.'=>'WooCommerce 4.0のリリースに伴い、これらのレポートは置き換えられます。 WordPress 5.3以降をご利用の方のために、新しくて便利な「アナリティクス」セクションが用意されています。 <a href="%1$s">WooCommerce Analytics</a> にアクセスするか、<a href="https://woocommerce.com/document/woocommerce-analytics/" target="_blank">WooCommerce Analytics ドキュメント</a>で新しいエクスペリエンスの詳細をご確認ください。','With WooPayments, you can securely accept major cards, Apple Pay, and payments in over 100 currencies – with no setup costs or monthly fees – and you can now accept in-person payments with the Woo mobile app.'=>'WooPayments を使用すると、主要なカード、Apple Pay、100以上の通貨での支払いを、設定費用や毎月の料金なしで安全に受け取ることができます。Woo モバイルアプリでは、オフラインでの支払いを受け取れるようになりました。','With WooPayments, you can securely accept major cards, Apple Pay, and payments in over 100 currencies. Track cash flow and manage recurring revenue directly from your store’s dashboard - with no setup costs or monthly fees.'=>'WooPayments を使用すると、主要なカードや Apple Pay、100種類以上の通貨での支払いを安全に受け取ることができます。 ストアのダッシュボードからキャッシュフローの把握や定期的な収益の管理を直接行うことができ、設定料や月額費用はかかりません。','WooCommerce'=>'WooCommerce','woocommerce'=>'woocommerce','WooCommerce %1$s table creation failed. Does the %2$s user have CREATE privileges on the %3$s database?'=>'WooCommerce %1$s テーブル作成が失敗しました。 %2$s ユーザーには %3$s データベースでの作成権限がありますか ?','WooCommerce &rsaquo; Setup Wizard'=>'WooCommerce &rsaquo; 設定ウィザード','WooCommerce action names associated with the webhook.'=>'webhook に関連付けられている WooCommerce のアクション名。','WooCommerce Admin'=>'WooCommerce Admin','WooCommerce Admin has been disabled'=>'WooCommerce Admin が無効化されています','WooCommerce Admin icon'=>'WooCommerce Admin のアイコン','WooCommerce API. Use a consumer key in the username field and a consumer secret in the password field.'=>'WooCommerce API。consumer key にユーザー名を、consumer secret にパスワードを使います。','WooCommerce Blocks development mode requires files to be built. From the root directory, run %1$s to ensure your node version is aligned, run %2$s to install dependencies, %3$s to build the files or %4$s to build the files and watch for changes.'=>'WooCommerce ブロック開発モードでは、ファイルをビルドする必要があります。 ルートディレクトリからノードバージョンが一致していることを確認する場合は %1$s、依存関係をインストールする場合は %2$s、ファイルをビルドする場合は %3$s、ファイルをビルドして変化を監視する場合は %4$s を実行します。','WooCommerce Brand Description'=>'WooCommerce Brand の説明','WooCommerce Brand Layered Nav'=>'WooCommerce Brand 階層化ナビ','WooCommerce Brand Thumbnails'=>'WooCommerce Brand ポスター画像','WooCommerce can accept both online and offline payments. <a href="%s" target="_blank">Additional payment methods</a> can be installed later.'=>'WooCommerce はオンラインとオフラインの両方の支払いに対応できます。<a href="%s" target="_blank">その他の支払い方法</a>を後でインストールできます。','WooCommerce Customer Data'=>'WooCommerce の顧客データ','WooCommerce Customer Downloads'=>'WooCommerce 顧客によるダウンロード','WooCommerce Customer Orders'=>'WooCommerce 顧客による注文','WooCommerce Customer Payment Tokens'=>'WooCommerce 顧客決済トークン','WooCommerce database update'=>'WooCommerce データ更新','WooCommerce database update complete. Thank you for updating to the latest version!'=>'WooCommerce のデータの更新が完了しました。ありがとうございます。最新バージョンに更新しました。','WooCommerce database update done'=>'WooCommerce データベースの更新完了','WooCommerce database update in progress'=>'WooCommerce データベースを更新中','WooCommerce database update required'=>'WooCommerce データベースの更新が必要です','WooCommerce database version'=>'WooCommerce データベースバージョン','WooCommerce Endpoint'=>'WooCommerce エンドポイント','WooCommerce Endpoints'=>'WooCommerce エンドポイント','WooCommerce endpoints'=>'WooCommerce 