y disconnected your store from WooCommerce.com'=>'WooCommerce.com とストアの連携を切断しました','You have used this coupon %s in another transaction during this checkout, and coupon usage limit is reached. Please remove the coupon and try again.'=>'この購入手続き中に別のトランザクションでこのクーポン %s を使用したため、クーポンの使用制限に達しました。クーポンを削除してもう一度お試しください。','You may also like&hellip;'=>'こちらもおすすめ&hellip;','You may be interested in&hellip;'=>'こちらの商品はいかがでしょうか &hellip;','You may be interested in…'=>'こちらの商品はいかがでしょうか...','You may need to manually restore the item\'s stock.'=>'商品の在庫を手動で復元する必要があります。','You may want to switch to the database for log storage.'=>'ログストレージのデータベースに切り替える必要があるかもしれません。','You must be %1$slogged in%2$s to post a review.'=>'レビューを投稿するには%1$sログイン%2$sする必要があります。','You must be logged in to checkout.'=>'購入手続きを行うには、ログインしている必要があります。','You must be logged in to download files.'=>'ファイルをダウンロードするにはログインが必要です。','You must enter a valid license key on the <a href="%1$s">MaxMind integration settings page</a> in order to use the geolocation service. If you do not need geolocation for shipping or taxes, you should change the default customer location on the <a href="%2$s">general settings page</a>.'=>'位置情報サービスを使用するには、<a href="%1$s">MaxMind連携設定ページ</a>で有効なライセンスキーを入力する必要があります。 送料や税金のために位置情報が必要ない場合は、<a href="%2$s">一般設定ページ</a>でデフォルトの顧客の場所を変更する必要があります。','You must supply an array of options and values.'=>'オプションの配列と値を入力する必要があります。','You must supply an array of options.'=>'オプションの配列を入力する必要があります。','You need WooCommerce 4.2 or newer to run this tool.'=>'このツールを実行するには、WooCommerce 4.2以降が必要です。','You want your product catalog and images to look great and align with your brand. This guide will give you all the tips you need to get your products looking great in your store.'=>'商品のカタログと画像の見栄えを良くし、ブランドに合ったものにしたいとお考えですか。 このガイドでは、ストア内で商品の見栄えを良くするのに必要なすべてのヒントをご紹介します。','You will need to manually issue a refund through your payment gateway after using this.'=>'これを使ったあとに支払い方法を通して手動で払い戻しをする必要があります。','You\'re almost there! Once you complete store setup you can start receiving orders.'=>'もうすぐです ! ストアの設定を完了したら、受注を開始できます。','You\'re invited to share your experience'=>'エクスペリエンスを共有するよう招待されました','You\'re only one step away from getting paid. Verify your business details to start managing transactions with WooPayments.'=>'あと1ステップで支払いを受けることができます。 ビジネスの詳細を確認して、WooPayments でトランザクションの管理を開始します。','You\'re ready to add products to your store.'=>'商品をストアに追加する準備が整いました。','You\'re ready to start selling!'=>'今すぐ販売を開始できます。','You\'ve hit the 10 orders milestone! Look at you go. Browse some WooCommerce success stories for inspiration.'=>'0件の注文マイルストーンを達成しました ! 好調です。WooCommerce の成功事例を見て、インスピレーションを得てみませんか。','Your account has been successfully created'=>'アカウントが作成されました','Your account was created successfully and a password has been sent to your email address.'=>'アカウントが作成され、お使いのメールアドレスにパスワードを送信しました。','Your account was created successfully. Your login details have been sent to your email address.'=>'アカウントが作成されました。お使いのメールアドレスにログインの詳細を送信しました。','Your account with %s has been successfully created. We emailed you a link to set your account password.'=>'%s のアカウントが作成されました。 アカウントのパスワードを設定するためのリンクをメールしました。','Your cart is currently empty!'=>'現在お買い物カゴには何も入っていません。','Your cart is currently empty.'=>'現在お買い物カゴには何も入っていません。','Your changed data will be lost if you leave this page without saving.'=>'保存せずにこのページを移動すれば、変更されたデータが失われます。','Your changes have been saved.'=>'変更を保存しました。','Your changes were not saved. Please retry.'=>'変更が保存されませんでした。再度対応ください。','Your CSV needs to include columns in a specific order. %1$sClick here to download a sample%2$s.'=>'CSV 内に、決められた順序で列を含める必要があります。%1$sここをクリックしてサンプルをダウンロードしてください%2$s。','Your current password is incorrect.'=>'現在のパスワードは正しくありません。','Your customers will see the name of this shipping method during checkout.'=>'顧客には購入手続き時にこの配送方法名が表示されます。','Your installation of WooCommerce is incomplete. If you installed WooCommerce from GitHub, %1$splease refer to this document%2$s to set up your development environment.'=>'WooCommerce はインストールが完了していません。GitHub (%1$s) から WooCommerce をインストールした場合は %2$s のドキュメントを参照して開発環境を設定してください。','Your installation of WooCommerce is incomplete. If you installed WooCommerce from GitHub, please refer to this document to set up your development environment: https://github.com/woocommerce/woocommerce/wiki/How-to-set-up-WooCommerce-development-environment'=>'WooCommerce はインストールが完了していません。GitHub から WooCommerce をインストールした場合は、こちらのドキュメントを参照して開発環境を設定してください。https://github.com/woocommerce/woocommerce/wiki/How-to-set-up-WooCommerce-development-environment','Your order'=>'ご注文','Your order at {site_title} was unsuccessful'=>'{site_title} でのご注文は失敗しました','Your order can no longer be cancelled. Please contact us if you need assistance.'=>'ご注文をキャンセルできる期限が過ぎています。ヘルプが必要な場合はお問い合わせください。','Your order cannot be processed as the originating bank/merchant has declined your transaction. Please attempt your purchase again.'=>'銀行または販売者がトランザクションを拒否したため、ご注文を処理できませんでした。 もう一度ご購入手続きをお試しください。','Your order details are as follows:'=>'注文の詳細は次のとおりです。','Your order has been cancelled.'=>'注文はキャンセルされました。','Your order on %s has been partially refunded. There are more details below for your reference:'=>'%s での注文を部分的に払い戻ししました。参考のために詳細情報を以下にお知らせします。','Your order on %s has been refunded. There are more details below for your reference:'=>'%s での注文を払い戻ししました。参考のために詳細情報を以下にお知らせします。','Your order was cancelled.'=>'注文をキャンセルしました。','Your order was refunded %s.'=>'注文は%sに返金されました。','Your password has been reset successfully.'=>'パスワードが正常にリセットされました。','Your personal data will be used to process your order, support your experience throughout this website, and for other purposes described in our %s.'=>'個人データは、注文の処理、このサイトでの利用サポート、%s に説明されている他の用途に使用されます。','Your personal data will be used to support your experience throughout this website, to manage access to your account, and for other purposes described in our %s.'=>'個人データは、このウェブサイトでの体験のサポート、アカウントへのアクセスの管理、%s に説明されている他の用途に使用されます。','Your products are now being imported...'=>'商品は現在インポートされています...','Your rating'=>'評価','Your Report Download'=>'レポートのダウンロード','Your report file is being generated.'=>'レポートファイルを生成中です。','Your review'=>'レビュー','Your review is awaiting approval'=>'コメントは承認待ちです','Your selection has been reset. Please select some product options before adding this product to your cart.'=>'選択内容がリセットされました。 この商品をお買い物カゴに追加する前に商品オプションを選択してください。','Your server does not have fsockopen or cURL enabled - PayPal IPN and other scripts which communicate with other servers will not work. Contact your hosting provider.'=>'ご使用のサーバーには、fsockopen が無いか、cURL が有効になっていません。- PayPal IPN および他のサーバと通信する他のスクリプトが動作しません。ホスティングプロバイダにお問い合わせください。','Your server does not have the %s class enabled - HTML/Multipart emails, and also some extensions, will not work without DOMDocument.'=>'お使いのサーバーでは %s クラスが有効化されていません。HTML / マルチパートメールと一部の拡張機能は DOMDocument なしでは動作しません。','Your server does not have the %s class enabled - some gateway plugins which use SOAP may not work as expected.'=>'ご利用中のサーバーでは %s クラスが有効化されていません。SOAP を使用している一部のゲートウェイプラグインが予期しない動作をするかもしれません。','Your server does not support the %s function - this is required to use the GeoIP database from MaxMind.'=>'サーバーは %s 関数をサポートしていません。これは MaxMind の GeoIP データベースを使用するために必要です。','Your server does not support the %s functions - this is required for better character encoding. Some fallbacks will be used instead for it.'=>'ご利用中のサーバーでは %s 関数をサポートしていません。この関数は、より良い文字エンコーディングのために必要です。代わりに一部のフォールバックが使われます。','Your settings have been saved.'=>'設定を保存しました。','Your site might be on a private network. Jetpack can only connect to public sites. Please make sure your site is visible over the internet, and then try connecting again 🙏.'=>'サイトがプライベートネットワークにあるようです。Jetpack は公開サイトとのみ連携できます。サイトがインターネット上で表示できることをご確認の上、再連携をお試しください 🙏。','Your store address is required to set the origin country for shipping, currencies, and payment options.'=>'配送元の国、通貨、支払いオプションを設定するには店舗の所在地が必要です。','Your store does not appear to be using a secure connection. We highly recommend serving your entire website over an HTTPS connection to help keep customer data secure. <a href="%s">Learn more here.</a>'=>'ストアでは安全な接続が使用されていないようです。顧客データを安全に保管するため、ウェブサイト全体を HTTPS 接続を使用して運用することを強くおすすめします。<a href="%s">詳しくはこちらをご覧ください。</a>','Your store is almost ready! To activate services like %s, just connect with Jetpack.'=>'もうすぐストアをご利用いただけます。Jetpack と連携するだけで、%s などのサービスを有効にできます。','Your store is already connected.'=>'ストアはすでに連携されています。','Your store is configured to serve digital products using "Redirect only" method. This method is deprecated, <a href="%s">please switch to a different method instead.</a><br><em>If you use a remote server for downloadable files (such as Google Drive, Dropbox, Amazon S3), you may optionally wish to "allow using redirects as a last resort". Enabling that and/or selecting any of the other options will make this notice go away.</em>'=>'あなたのストアは「転送のみ」方式を使って、デジタル商品の販売用に構成されます。 この方式は推奨されません。<a href="%s">別の方式に変更してください。</a><br><em>ダウンロード可能なファイルにリモートサーバー (Google Drive、Dropbox、Amazon S3など) を使用している場合は、オプションで「最後の手段として転送の使用を許可」することをおすすめします。 この通知を消すには、このオプションを有効にするか、他のオプションを選択してください。</em>','Your store is not connected to WooCommerce.com. Run `wp wc com connect` command.'=>'ストアは WooCommerce.com と連携されていません。 「wp wc com connect」コマンドを実行します。','Your store is not using HTTPS. <a href="%s" target="_blank">Learn more about HTTPS and SSL Certificates</a>.'=>'このストアでは HTTPS は使用されていません。<a href="%s" target="_blank">HTTPS や SSL 証明書の詳細を確認してください</a>。','Your store is using shortcode checkout. Use the Checkout blocks to activate this option.'=>'ストアではショートコード購入手続きを使用しています。 このオプションを有効にするには、購入手続きブロックを使用します。','Your store might be at risk as you are running old versions of WooCommerce plugins.'=>'古いバージョンの WooCommerce プラグインを実行しているため、ストアが危険にさらされている可能性があります。','Your store\'s uploads directory is <a href="%1$s">browsable via the web</a>. We strongly recommend <a href="%2$s">configuring your web server to prevent directory indexing</a>.'=>'ストアのアップロードディレクトリは <a href="%1$s">Web 経由でブラウズ可能</a>です。<a href="%2$s">ディレクトリインデックシングを回避するよう Web サーバーを設定</a>することを強くおすすめします。','Your subscription expired on %s. Get a new subscription to continue receiving updates and access to support.'=>'ご利用のサブスクリプションは%sに期限切れになります。引き続き最新情報を受信し、サポートを利用するには、サブスクリプションを更新してください。','Your subscription expires in %d days. Enable autorenew to avoid losing updates and access to support.'=>'ご利用のサブスクリプションは、あと%d日で期限切れとなります。更新やサポートへのアクセスを失わないように、自動更新を有効にしてください。','Your subscription for <strong>%1$s</strong> expired. <a href="%3$s">%4$s</a> to continue receiving updates and streamlined support.'=>'<strong>%1$s</strong> のサブスクリプションが期限切れになりました。引き続きアップデートを受信して最新のサポートを利用するには、<a href="%3$s">%4$s</a>します。','Your subscription for <strong>%1$s</strong> expires on %2$s. <a href="%3$s">Enable auto-renewal</a> to continue receiving updates and streamlined support.'=>'<strong>%1$s</strong>のサブスクリプションが%2$sで期限切れになります。 引き続きアップデートを受信して効率的なサポートを利用するには、<a href="%3$s">自動更新を有効化</a>します。','Your subscription has been connected.'=>'サブスクリプションは連携されました。','Your subscription has been disconnected.'=>'サブスクリプションの連携を解除しました。','Your theme has a woocommerce.php file, you will not be able to override the woocommerce/archive-product.php custom template since woocommerce.php has priority over archive-product.php. This is intended to prevent display issues.'=>'テーマに woocommerce.php ファイルが存在しています。woocommerce.php は archive-product.php よりも優先されるため、woocommerce/archive-product.php のカスタムテンプレートを上書きすることはできません。','Your WooCommerce extension subscription is missing a payment method for renewal. <a href="%s">Add a payment method</a> to ensure you continue receiving updates and streamlined support.'=>'WooCommerce 拡張機能のサブスクリプションに更新の支払い方法がありません。 引き続きアップデートを受信して効率的なサポートを利用するには、<a href="%s">支払い方法を追加</a>してください。' . "\0" . '','Your WooCommerce extension subscription is missing a payment method for renewal. Add a payment method to ensure you continue receiving updates and streamlined support.'=>'WooCommerce 拡張機能のサブスクリプションに更新の支払い方法がありません。 引き続きアップデートを受信して効率的なサポートを利用するには、支払い方法を追