o Change —'=>'— 変更なし —','— No change —'=>'— 変更なし —','“New Account” emails are sent when a customer signs up via the checkout flow.'=>'「新しいアカウント」メールは、顧客が購入手続きフローでサインアップすると送信されます。','ℹ️ WooCommerce installed and activated <a href="%1$s">the Legacy REST API plugin</a> because this site has <a href="%2$s">the Legacy REST API enabled</a> or has <a href="%3$s">legacy webhooks defined</a>. <a href="%4$s">More information</a>'=>'ℹ️ このサイトでは<a href="%2$s">レガシー REST API が有効化されている</a>か、<a href="%3$s">レガシー Webhook が定義されている</a>ため、WooCommerce は<a href="%1$s">レガシー REST API プラグイン</a>をインストールして有効化しました。 <a href="%4$s">詳細情報</a>','ℹ️️ The WooCommerce Legacy REST API extension is installed and active.'=>'ℹ️️ WooCommerce レガシー REST API 拡張機能がインストールされ、有効になっています。','⚠ 1 Incompatible plugin detected (%s).'=>'⚠ 互換性のないプラグインが1個検出されました (%s)。','⚠ 2 Incompatible plugins detected (%1$s and %2$s).'=>'⚠ 互換性のないプラグインが2個検出されました (%1$s および %2$s)。','⚠ <b><a target="_blank" href="%s">The Legacy REST API plugin</a> is installed and active on this site.</b> Please be aware that the WooCommerce Legacy REST API is <b>not</b> compatible with HPOS.'=>'⚠ このサイトでは、<b><a target="_blank" href="%s">レガシー REST API </a> がインストールされ有効になっています。</b>WooCommerce のレガシー REST API は HPOS と互換性が<b>ありません</b>。','⚠ <b><a target="_blank" href="%s">The Legacy REST API</a> is active on this site.</b> Please be aware that the WooCommerce Legacy REST API is <b>not</b> compatible with HPOS.'=>'⚠ <b><a target="_blank" href="%s">レガシー REST API </a> がサイトで有効になっています。</b>WooCommerce のレガシー REST API は HPOS と互換性が<b>ありません</b>。','⚠ Incompatible plugins detected (%1$s, %2$s and %3$d other).'=>'⚠ 互換性のないプラグインが検出されました (%1$s および %2$s、ほか%3$d個のプラグイン)。' . "\0" . '','⚠ This feature is compatible with WordPress version 6.2 or higher.'=>'⚠ この機能は WordPress バージョン6.2以降と互換性があります。','⚠ This plugin is incompatible with the enabled WooCommerce feature \'%s\', it shouldn\'t be activated.'=>'⚠ このプラグインは有効になっている WooCommerce 機能「%s」と互換性がないため、有効化しないでください。','⚠ This plugin is incompatible with the enabled WooCommerce features \'%1$s\' and \'%2$s\', it shouldn\'t be activated.'=>'⚠ このプラグインは有効になっている WooCommerce 機能「%1$s」、「%2$s」と互換性がないため、有効化しないでください。','⚠ This plugin is incompatible with the enabled WooCommerce features \'%1$s\', \'%2$s\' and %3$d more, it shouldn\'t be activated.'=>'⚠ このプラグインは有効になっている WooCommerce 機能「%1$s」、「%2$s」、%3$d などと互換性がないため、有効化しないでください。','⚠️ Only %s files can be searched at one time. Try filtering the file list before searching.'=>'⚠️ 一度に検索できるのは%sファイルのみです。 検索する前にファイルリストを絞り込んでみてください。','⚠️ The file system connection could not be initialized.'=>'⚠️ ファイルシステム接続を初期化できませんでした。','⚠️ The file system is not configured for direct writes. This could cause problems for the logger.'=>'⚠️ ファイルシステムが直接書き込み用に設定されていません。 これにより、ロガーに問題が発生する可能性があります。','⚠️ The WooCommerce Legacy REST API has been moved to <a target=”_blank” href="%1$s">a dedicated extension</a>. <b><a target=”_blank” href="%2$s">Learn more about this change</a></b>'=>'⚠️ WooCommerce レガシー REST API は<a target=”_blank” href="%1$s">専用の拡張機能</a>に移動しました。 <b><a target=”_blank” href="%2$s">この変更についての詳細は、こちらをご覧ください</a></b>','⚠️ The WooCommerce Legacy REST API has been removed from WooCommerce, this will cause <a href="%1$s">webhooks on this site that are configured to use the Legacy REST API</a> to stop working. <a target="_blank" href="%2$s">A separate WooCommerce extension is available</a> to allow these webhooks to keep using the Legacy REST API without interruption. You can also edit these webhooks to use the current REST API version to generate the payload instead. <b><a target="_blank" href="%3$s">Learn more about this change.</a></b>'=>'⚠️ WooCommerce のレガシー REST API は WooCommerce から削除されました。これに伴い、<a href="%1$s">レガシー REST API を使用するよう設定されているこのサイトの Webhook</a> は機能しなくなります。 <a target="_blank" href="%2$s">個別の WooCommerce 拡張機能を使用</a>すると、中断なくこのような Webhook で引き続きレガシー REST API を使用できます。 現在の REST API バージョンを使用してペイロードを生成するように、この Webhook を編集することもできます。 <b><a target="_blank" href="%3$s">この変更についての詳細をご覧ください。</a></b>','⚠️ This directory does not appear to be writable.'=>'⚠️ このディレクトリは書き込み可能ではないようです。','⚠️ WooCommerce attempted to install <a href="%1$s">the Legacy REST API plugin</a> because this site has <a href="%2$s">the Legacy REST API enabled</a> or has <a href="%3$s">legacy webhooks defined</a>, but the installation failed (see error details in <a href="%4$s">the WooCommerce logs</a>). Please install and activate the plugin manually. <a href="%5$s">More information</a>'=>'⚠️ このサイトでは<a href="%2$s">レガシー REST API が有効化されている</a>か、<a href="%3$s">レガシー Webhook が定義されている</a>ため、WooCommerce は<a href="%1$s">レガシー REST API プラグイン</a>をインストールしようとしましたが、インストールに失敗しました (<a href="%4$s">WooCommerce ログ</a>のエラー詳細を参照してください)。 プラグインを手動でインストールして有効化してください。 <a href="%5$s">詳細情報</a>','⚠️ WooCommerce installed <a href="%1$s">the Legacy REST API plugin</a> because this site has <a href="%2$s">the Legacy REST API enabled</a> or has <a href="%3$s">legacy webhooks defined</a>, but it failed to activate it (see error details in <a href="%4$s">the WooCommerce logs</a>). Please go to <a href="%5$s">the plugins page</a> and activate it manually. <a href="%6$s">More information</a>'=>'⚠️ このサイトでは<a href="%2$s">レガシー REST API が有効化されている</a>か、<a href="%3$s">レガシー Webhook が定義されている</a>ため、WooCommerce は<a href="%1$s">レガシー REST API プラグイン</a>をインストールしましたが、有効化に失敗しました (<a href="%4$s">WooCommerce ログ</a>のエラー詳細を参照してください)。 <a href="%5$s">プラグインページ</a>に移動して手動で有効化してください。 <a href="%6$s">詳細情報</a>','✅ Ready'=>'✅ 準備完了']];
